import React from "react";

const Accordian1 = () => {
  return (
    <div className="w-[1264px] h-[90px] flex justify-between rounded-xl mt-6 items-center border border-gray-100">
      <div className="flex gap-4 mx-4">
        <img src="images/Group 87.png" alt="group" />
        <h1>1. Corriss Ambady</h1>
      </div>
      <div>
        <img src="images/Vector8.png" alt="vector" />
      </div>
    </div>
  );
};

export default Accordian1;
